// ==UserScript==
// @name           hwm_map_forever
// @namespace      Demin_169161
// @author         Demin
// @description    Перемещение по карте в 1 клик с любой страницы (только с конём и выше)
// @homepage       https://greasyfork.org/en/scripts/374611-hwm-map-forever
// @icon           https://i.imgur.com/LZJFLgt.png
// @version        2.17.r5
// @encoding       utf-8
// @include        https://www.heroeswm.ru/*
// @include        https://www.lordswm.com/*
// @include        http://178.248.235.15/*
// @exclude        /^https:\/\/www\.heroeswm\.ru\/(login|war|cgame|frames|chat|chatonline|ch_box|chat_line|ticker|chatpost)\.php.*/
// @exclude        */ticker.html*
// @exclude        */rightcol.php*
// @exclude        */war.php*
// @exclude        */cgame.php*
// @exclude        */ch_box.php*
// @exclude        */chat*
// @exclude        */ticker.html*
// @exclude        */frames*
